-- ----------------------------
-- Estrutura da tabela: tbl_caixas_mistas_header
-- ----------------------------
DROP TABLE IF EXISTS `tbl_caixas_mistas_header`;
CREATE TABLE `tbl_caixas_mistas_header` (
  `mista_id` int(11) NOT NULL AUTO_INCREMENT,
  `mista_produto_final_id` int(11) NOT NULL COMMENT 'FK para tbl_produtos. O ID do produto final. Ex: "Caixa Mista 10kg".',
  `mista_lote_destino_id` int(11) NOT NULL COMMENT 'FK para tbl_lotes_novo_header. O Lote ao qual esta nova caixa pertencerá.',
  `mista_data_criacao` timestamp NOT NULL DEFAULT current_timestamp(),
  `mista_usuario_id` int(11) NOT NULL COMMENT 'FK para tbl_usuarios. Quem criou.',
  `mista_item_embalagem_id_gerado` int(11) DEFAULT NULL COMMENT 'FK para tbl_lotes_novo_embalagem. O item que será gerado e etiquetado.',
  PRIMARY KEY (`mista_id`),
  KEY `fk_mista_produto_idx` (`mista_produto_final_id`),
  KEY `fk_mista_lote_destino_idx` (`mista_lote_destino_id`),
  KEY `fk_mista_usuario_idx` (`mista_usuario_id`),
  KEY `fk_mista_item_emb_idx` (`mista_item_embalagem_id_gerado`),
  CONSTRAINT `fk_mista_item_emb` FOREIGN KEY (`mista_item_embalagem_id_gerado`) REFERENCES `tbl_lotes_novo_embalagem` (`item_emb_id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_mista_lote_destino` FOREIGN KEY (`mista_lote_destino_id`) REFERENCES `tbl_lotes_novo_header` (`lote_id`) ON UPDATE CASCADE,
  CONSTRAINT `fk_mista_produto` FOREIGN KEY (`mista_produto_final_id`) REFERENCES `tbl_produtos` (`prod_codigo`) ON UPDATE CASCADE,
  CONSTRAINT `fk_mista_usuario` FOREIGN KEY (`mista_usuario_id`) REFERENCES `tbl_usuarios` (`usu_codigo`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='Armazena a definição (cabeçalho) de Caixas Mistas criadas a partir de sobras.';

-- ----------------------------
-- Dados da tabela: tbl_caixas_mistas_header
-- ----------------------------

-- ----------------------------
-- Estrutura da tabela: tbl_caixas_mistas_itens
-- ----------------------------
DROP TABLE IF EXISTS `tbl_caixas_mistas_itens`;
CREATE TABLE `tbl_caixas_mistas_itens` (
  `item_mista_id` int(11) NOT NULL AUTO_INCREMENT,
  `item_mista_header_id` int(11) NOT NULL COMMENT 'FK para tbl_caixas_mistas_header. A qual caixa este item pertence.',
  `item_prod_origem_id` int(11) NOT NULL COMMENT 'FK para tbl_lotes_novo_producao. A "sobra" específica que foi consumida.',
  `item_mista_qtd_consumida` decimal(10,3) NOT NULL COMMENT 'A quantidade que foi baixada do saldo da sobra.',
  PRIMARY KEY (`item_mista_id`),
  KEY `fk_mista_item_header_idx` (`item_mista_header_id`),
  KEY `fk_mista_item_origem_idx` (`item_prod_origem_id`),
  CONSTRAINT `fk_mista_item_header` FOREIGN KEY (`item_mista_header_id`) REFERENCES `tbl_caixas_mistas_header` (`mista_id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `fk_mista_item_origem` FOREIGN KEY (`item_prod_origem_id`) REFERENCES `tbl_lotes_novo_producao` (`item_prod_id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='Armazena os itens de origem (sobras) que compõem uma Caixa Mista.';

-- ----------------------------
-- Dados da tabela: tbl_caixas_mistas_itens
-- ----------------------------

-- ----------------------------
-- Estrutura da tabela: tbl_carregamento_fila_fotos
-- ----------------------------
DROP TABLE IF EXISTS `tbl_carregamento_fila_fotos`;
CREATE TABLE `tbl_carregamento_fila_fotos` (
  `foto_id` int(11) NOT NULL AUTO_INCREMENT,
  `foto_fila_id` int(11) NOT NULL,
  `foto_path` varchar(255) NOT NULL,
  `foto_timestamp` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`foto_id`),
  KEY `idx_fila` (`foto_fila_id`),
  CONSTRAINT `fk_foto_fila` FOREIGN KEY (`foto_fila_id`) REFERENCES `tbl_carregamento_filas` (`fila_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

