-- Dados da tabela: tbl_carregamento_fila_fotos
-- ----------------------------

-- ----------------------------
-- Estrutura da tabela: tbl_carregamento_filas
-- ----------------------------
DROP TABLE IF EXISTS `tbl_carregamento_filas`;
CREATE TABLE `tbl_carregamento_filas` (
  `fila_id` int(11) NOT NULL AUTO_INCREMENT,
  `fila_carregamento_id` int(11) NOT NULL,
  `fila_numero_sequencial` int(11) NOT NULL,
  `fila_foto_path` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`fila_id`),
  UNIQUE KEY `fila_carregamento_id` (`fila_carregamento_id`,`fila_numero_sequencial`)
) ENGINE=InnoDB AUTO_INCREMENT=70 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

