-- ----------------------------
-- Estrutura da tabela: tbl_carregamento_itens
-- ----------------------------
DROP TABLE IF EXISTS `tbl_carregamento_itens`;
CREATE TABLE `tbl_carregamento_itens` (
  `car_item_id` int(11) NOT NULL AUTO_INCREMENT,
  `car_item_carregamento_id` int(11) NOT NULL,
  `car_item_cliente_id` int(11) NOT NULL COMMENT 'ID do cliente comprador para este item',
  `car_item_lote_novo_item_id` int(11) NOT NULL,
  `car_item_quantidade` decimal(10,3) NOT NULL COMMENT 'Quantidade do item que está a sair',
  `car_item_data_adicionado` timestamp NOT NULL DEFAULT current_timestamp(),
  `car_item_fila_id` int(11) NOT NULL,
  PRIMARY KEY (`car_item_id`),
  KEY `car_item_carregamento_id` (`car_item_carregamento_id`),
  KEY `car_item_cliente_id` (`car_item_cliente_id`),
  KEY `fk_itens_lote_novo_item` (`car_item_lote_novo_item_id`),
  KEY `fk_itens_fila` (`car_item_fila_id`),
  CONSTRAINT `fk_itens_carregamento` FOREIGN KEY (`car_item_carregamento_id`) REFERENCES `tbl_carregamentos` (`car_id`) ON DELETE CASCADE,
  CONSTRAINT `fk_itens_cliente` FOREIGN KEY (`car_item_cliente_id`) REFERENCES `tbl_entidades` (`ent_codigo`),
  CONSTRAINT `fk_itens_fila` FOREIGN KEY (`car_item_fila_id`) REFERENCES `tbl_carregamento_filas` (`fila_id`) ON DELETE CASCADE,
  CONSTRAINT `fk_itens_lote_novo_item` FOREIGN KEY (`car_item_lote_novo_item_id`) REFERENCES `tbl_lotes_novo_embalagem` (`item_emb_id`)
) ENGINE=InnoDB AUTO_INCREMENT=166 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

